import { FriendListItemEl } from "components/FriendListItem/FriendListItem"
import { List } from "./FriendsList.styled"

export const FriendListEl = ({friends}) =>{
    return(
        <List>
           {friends.map(friend=>(
            <li key  ={friend.id}>
              <FriendListItemEl friend = {friend}/>
            </li>
           ))}
</List>
    )
}
